'Welcome to your b2evolution-powered website!' => 'Добро пожаловать на ваш b2evolution веб-сайт!',
"<p>To get you started, the installer has automatically created several sample collections and populated them with some sample contents. Of course, this starter structure is all yours to edit. Until you do that, though, here's what you will find on this site:</p>\n\n<ul>\n<li><strong>Blog A</strong>: You are currently looking at it. It contains a few sample posts, using simple features of b2evolution.</li>\n<li><strong>Blog B</strong>: You can access it from the link at the top of the page. It contains information about more advanced features. Note that it is deliberately using a different skin from Blog A to give you an idea of what's possible.</li>\n<li><strong>Photos</strong>: This collection is an example of how you can use b2evolution to showcase photos, with photos grouped into photo albums.</li>\n<li><strong>Forums</strong>: This collection is a discussion forum (a.k.a. bulletin board) allowing your users to discuss among themselves.</li>\n<li><strong>Manual</strong>: This showcases how b2evolution can be used to publish structured content such as an online manual or book.</li>\n\n</ul>\n\n<p>You can add new collections of any type (blog, photos, forums, etc.), delete unwanted one and customize existing collections (title, sidebar, blog skin, widgets, etc.) from the admin interface.</p>" => "<p>Чтобы вы начали, установщик автоматически создал несколько коллекций и заполнил их содержимым. Конечно, это начальная структура, и вы можете это все отредактировать. Пока вы этого не сделали, здесь то что вы найдете на этом сайте:</p>\n\n<ul>\n<li><strong>Блог A</strong>: Вы его видите прямо сейчас. Он содержит несколько записей, использующих основные возможности b2evolution.</li>\n<li><strong>Блог B</strong>: Вы можете перейти к нему по ссылке вверху страницы. Он содержит информацию о дополнительных возможностях системы. Обратите внимание, что специально используется другая тема отличная от Блога А, чтобы дать вам представление о том, что это возможно.</li>\n<li><strong>Фотографии</strong>: Эта коллекция является примером использования b2evolution для создания фотоальбомов.</li>\n<li><strong>Форумы</strong>: Эта коллекция - форум обсуждений(подобно доске bulletin), позволяющий вашим пользователям обсуждать между собой.</li>\n<li><strong>Руководство</strong>: Это демонстрирует, как b2evolution может быть использован для публикации структурированного контента, такие как онлайн-руководство или книга.</li>\n\n</ul>\n\n<p>Вы можете добавить новые коллекции любого типа(блог, фотографии, форумы, и т.д.), удалить ненужные и настроить существующие коллекции (заголовок, боковую панель, тему, виджеты и т.п.) из панели управления.</p>",
'b2evo skins repository' => 'b2evo хранилище тем',
'About Blog B' => 'О блоге Б',
'Blog B' => 'Блог Б',
'This uses post type "Intro-Cat" and is attached to the desired Category(ies).' => 'Эта запись типа "Intro-Cat", она прикрепляется к необходимым Рубрикам.',
'b2evolution tips category &ndash; Sub Intro post' => 'Рубрика "советы по b2evolution" &ndash; Sub Intro запись',
'This uses post type "Intro-Tag" and is tagged with the desired Tag(s).' => 'Эта запись типа "Intro-Tag", она связана необходимыми Тегами.',
'Widgets tag &ndash; Sub Intro post' => 'Запись с тегом "widgets" &ndash; Sub Intro запись',
"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => "<p>Это пример избранной записи.</p>\n\n<p>Она будет выводиться первой в случаях, когда не задана специальная \"Вводная\" запись для текущего запроса.</p>\n\n<p>Заметьте, если запись является избранной, она не появляется в Основном потоке записей.</p>",
"<p>b2evolution comes with an <code>.htaccess</code> file destined to optimize the way b2evolution is handled by your webseerver (if you are using Apache). In some circumstances, that file may not be automatically activated at setup. Please se the man page about <a %s>Tricky Stuff</a> for more information.</p>\n\n<p>For further optimization, please review the manual page about <a %s>Performance optimization</a>. Depending on your current configuration and on what your <a %s>web hosting</a> company allows you to do, you may increase the speed of b2evolution by up to a factor of 10!</p>" => "<p>При установке b2evolution будет активирован файл <code>.htaccess</code>, в котором заданы параметры сервера (только для Apache), необходимые для оптимальной работы b2evolution. Если при установке b2evolution автоматическая активация этого файла не удалась, вам следует <a %s>обратиться к документации</a>.</p>\n\n<p>Для дальнейшей оптимизации, обратитесь к инструкции <a %s>Улучшение производительности</a>. В зависимости от текущих настроек, а так же от возможностей вашего <a %s>веб сервера</a> вы сможете увеличить скорость работы b2evolution до 10 раз!</p>",
'Apache optimization...' => 'Оптимизация Apache...',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => "<p>По умолчанию, блоги отображаются используя evoskin т.е. тему. Подробнее об использовании тем вы сможете прочесть в другой записи.</p>\n\n<p>Это означает что блоги вызываются через файл '<code>index.php</code>', который загружает исходные параметры из базы данных и затем \"показывает\" их через файлы темы.</p>\n\n<p>В случае, когда вы не хотите использовать параметры по умолчанию и хотите, скажем, вызвать тему, рубрику или определенный блог, вы можете создать файл-заглушку (stub file) как, например, '<code>a_stub.php</code>' и вызывать ваш блог через эту заглушку вместо index.php .</p>\n\n<p>И наконец, если вы хотите выполнить тонкую настройку вашего блога, вы можете использовать простые шаблоны вместо тем. В таком случае вы вызываете ваш блог через полный шаблон, как, например '<code>a_noskin.php</code>'.</p>\n\n<p>Если вы хотите интегрировать отдельный блог b2evolution в уже имеющийся сайт, вы, возможно, захотите сделать это путем вставки отдельных блоков кода из <code>a_noskin.php</code> в страницу вашего веб сайта.</p>\n\n<p>Дополнительную имформацию вы найдете непосредственно в файлах-заглушках и шаблонах. Откройте их в текстовом редакторе и прочитайте комментарии.</p>\n\n<p>В любом случае, убедитесь что вы установили корректный метод вызова (URL) ваших блогов в панели управления. В противном случае, постоянные ссылки не будут работать корректно.</p>",
'Skins, Stubs, Templates &amp; website integration...' => 'Темы, Заглушки, Шаблоны и интеграция сайта...',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: in order to be displayed, widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>Блоги b2evolution установлены с набором виджетов по умолчанию. Например, боковая панель этого блога включает такие виджеты как календарь, поле поиска, список рубрик, список лент XML, и т.д.</p>\n\n<p>Вы можете добавить, удалить или пересортировать виджеты из вкладки Настройки Блога в административном интерфейсе.</p>\n\n<p>Примечание: чтобы отображаться, виджеты помещаются в контейнеры. Каждый контейнер находится в определенном месте в теме. Если вы смените тему вашего блога, новая тема, возможно, не будет использовать те же контейнеры что и старая. Убедитесь что вы помещаете ваши виджеты в контейнеры, которые существуют в теме, которую вы используете.</p>",
'About widgets...' => 'О виджетах...',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"%s\" target=\"_blank\">manual on skins</a>!</p>" => "<p>По умолчанию, блоги b2evolution отображаются, используя evoskin.</p>\n\n<p>Вы можете изменить тему, используемую любым блогом, посредством редактирования настроек блога в панели управления.</p>\n\n<p>Вы можете загрузить дополнительные темы из <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">каталога тем сайта</a>. Для их установки, распакуйте их в директорию  /blogs/skins, затем идите в Основные настройки &gt; Темы в панели управления и нажмите \"Установить новый\".</p>\n\n<p>Вы также можете создать свою тему, скопировав, переименовав и изменив любую существующую папку темы из директории /blogs/skins.</p>\n\n<p>Для начала модификации темы, откройте ее файл \"<code>index.main.php</code>\" в редакторе и прочитайте комментарии там. Примечание: вы также можете редактировать темы во вкладке \"Файлы\" в панели управления.</p>\n\n<p>И конечно прочтите <a href=\"%s\" target=\"_blank\">руководство по темам</a>!</p>",
'About skins...' => 'О темах...',
'Sunset' => 'Закат',
'Bus Stop Ahead' => 'Bus Stop Ahead',
"Heading\n=======\n\nSub-heading\n-----------\n\n### H3 header\n\n#### H4 header ####\n\n> Email-style angle brackets\n> are used for blockquotes.\n\n> > And, they can be nested.\n\n> ##### Headers in blockquotes\n>\n> * You can quote a list.\n> * Etc.\n\n[This is a link](http://b2evolution.net/) if Links are turned on in the markdown plugin settings\n\nParagraphs are separated by a blank line.\n\n    This is a preformatted\n    code block.\n\nText attributes *Italic*, **bold**, `monospace`.\n\nShopping list:\n\n* apples\n* oranges\n* pears\n\nThe rain---not the reign---in Spain." => "Заголовок\n=======\n\nПод-заголовок\n-----------\n\n### H3 заголовок\n\n#### H4 заголовок ####\n\n> Угловые скобки\n> используются для цитат.\n\n> > И они могут быть вложенными.\n\n> ##### Заголовки в цитатах\n>\n> * Вы можете цитировать список.\n> * И т.д.\n\n[Это ссылка](http://b2evolution.net/) если Ссылки включены в настройках markdown плагина\n\nПараграфы разделяются пустой линией.\n\n    Это отформатированный\n    код блока.\n\nТекстовые атрибуты *Наклонный*, **жирный**, `линия кода`.\n\nСписок покупок:\n\n* яблоки\n* апельсины\n* груши\n\nДождь---не царствование---в Испании.",
'About Forums' => 'О форумах',
"<p>This is the first topic.</p>\n\n<p>It appears in a single category.</p>" => "<p>Это первый топик.</p>\n\n<p>Он появляется в одной рубрике.</p>",
'First Topic' => 'Первый топик',
"<p>This is the second topic.</p>\n\n<p>It appears in multiple categories.</p>" => "<p>Это второй топик.</p>\n\n<p>Он появляется в нескольких рубриках.</p>",
'Second topic' => 'Второй топик',
"<p>This topic has an image attached to it. The image is automatically resized to fit the current blog skin. You can zoom in by clicking on the thumbnail.</p>\n\n<p>Check out the photoblog (accessible through the links at the top) to see a completely different skin focused more on the photos than on the blog text.</p>" => "<p>Этот топик имеет прикрепленное изображение к нему. Изображение автоматически масштабируется под текущую тему блога. Вы можете увеличить, кликнув на картинку.</p>\n\n<p>Проверьте фотоблог (доступный через ссылки вверху), чтобы увидеть совершенно другую тему, сфокусированную на большем количестве фотографий, чем текстовый блог.</p>",
'Image topic' => 'Топик с изображением',
'This is a multipage topic' => 'Это многостраничный топик',
"<p>This is an extended topic with no teaser. This means that you won't see this teaser any more when you click the \"more\" link.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Это расширенный топик без вступления. Это означает, что вы не увидите это вступление, пока вы не нажмете на ссылку \"Читать далее\".</p>\n\n[teaserbreak]\n\n<p>Это расширенный текст. Вы можете прочитать это только после перехода по ссылке \"Читать далее\".</p>",
'Extended topic with no teaser' => 'Расширенный топик без вступления',
"<p>This is an extended topic. This means you only see this small teaser by default and you must click on the link below to see more.</p>\n\n[teaserbreak]\n\n<p>This is the extended text. You only see it when you have clicked the \"more\" link.</p>" => "<p>Это расширенный топик. Это означает, вы видите только это маленькое вступление по умолчанию, и вы должны нажать на ссылку ниже для просмотра записи целиком.</p>\n\n[teaserbreak]\n\n<p>Это расширенный текст. Вы можете прочитать это только после перехода по ссылке \"Читать далее\".</p>",
'Extended topic' => 'Расширенный топик',
